import React from "react";
import "./styles.css";



function Button(props) {
    const buttonStyle = STYLES.includes(buttonStyle) ? buttonStyle : STYLES[0];
    
    return (
        <>
            <button
            className={`btn ${buttonStyle}`}
            >
                {props.name}
            </button>
        </>
    )
}

export default Button
